/* istanbul ignore file */
/* tslint:disable */
/* eslint-disable */
import type { ExgernalObject } from '../models/ExgernalObject';
import type { RedirerectUrl } from '../models/RedirerectUrl';
import type { Vector } from '../models/Vector';
import type { VectorMetadata } from '../models/VectorMetadata';
import type { VectorRasterTuple } from '../models/VectorRasterTuple';
import type { CancelablePromise } from '../core/CancelablePromise';
import { request as __request } from '../core/request';

export class VectorService {

    /**
     * List Vector
     * @returns VectorRasterTuple Successful Response
     * @throws ApiError
     */
    public static listVectorVectorGet(): CancelablePromise<Array<VectorRasterTuple>> {
        return __request({
            method: 'GET',
            path: `/vector`,
        });
    }

    /**
     * Init Vector
     * @param requestBody
     * @returns Vector Successful Response
     * @throws ApiError
     */
    public static initVectorVectorPost(
        requestBody: VectorMetadata,
    ): CancelablePromise<Vector> {
        return __request({
            method: 'POST',
            path: `/vector`,
            body: requestBody,
            mediaType: 'application/json',
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Add Vector As Url
     * @param vectorId
     * @param requestBody
     * @returns Vector Successful Response
     * @throws ApiError
     */
    public static addVectorAsUrlVectorVectorIdUrlPut(
        vectorId: string,
        requestBody: ExgernalObject,
    ): CancelablePromise<Vector> {
        return __request({
            method: 'PUT',
            path: `/vector/${vectorId}/url`,
            body: requestBody,
            mediaType: 'application/json',
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Upload Vector
     * @param vectorId
     * @param formData
     * @returns Vector Successful Response
     * @throws ApiError
     */
    public static uploadVectorVectorVectorIdUploadPut(
        vectorId: string,
        formData: {
            file: Blob;
        },
    ): CancelablePromise<Vector> {
        return __request({
            method: 'PUT',
            path: `/vector/${vectorId}/upload`,
            formData: formData,
            mediaType: 'multipart/form-data',
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Delete Vector
     * @param vectorId
     * @returns void
     * @throws ApiError
     */
    public static deleteVectorVectorVectorIdDelete(
        vectorId: string,
    ): CancelablePromise<void> {
        return __request({
            method: 'DELETE',
            path: `/vector/${vectorId}`,
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Get Vector Data Url
     * @param vectorId
     * @returns RedirerectUrl Successful Response
     * @throws ApiError
     */
    public static getVectorDataUrlVectorVectorIdDataurlGet(
        vectorId: string,
    ): CancelablePromise<RedirerectUrl> {
        return __request({
            method: 'GET',
            path: `/vector/${vectorId}/dataurl`,
            errors: {
                422: `Validation Error`,
            },
        });
    }

    /**
     * Get Vector Data
     * @param vectorId
     * @returns void
     * @throws ApiError
     */
    public static getVectorDataVectorVectorIdDataGet(
        vectorId: string,
    ): CancelablePromise<void> {
        return __request({
            method: 'GET',
            path: `/vector/${vectorId}/data`,
            errors: {
                302: `Successful Response`,
                422: `Validation Error`,
            },
        });
    }

}
